import React,{useState} from 'react'
import './Cart.css'

const Cart = ({cart,setCart}) => {
  const [price,setPrice] = useState(0);

  return (
    <article>
      {
        cart.map((product)=>(
          <div className='cart_box' key={product.id}>
              <div className='cart_img'>
                <img src={product.img}/>
              </div>
          </div> 
        ))
        

      }
    </article>
  )
}

export default Cart
